import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container, Paper, makeStyles } from '@material-ui/core';
import { Padding } from '@mui/icons-material';

{/* <Box
component="form"
sx={{
  '& > :not(style)': { m: 1, width: '25ch' },
}}
noValidate
autoComplete="off"
>
</Box> */}
const useStyles = makeStyles((theme) => ({
  root: {
    '& > * ':{
      margin: theme.spacing(1),
    },
  },
}));

export default function Student() {
const paperStyle = {padding: '50px 20px', width: '200', margin: "20px auto"};
const classes = useStyles();

  return (

    <Container>
      <Paper elevation={3} style={paperStyle}>
          <h1 style={{color:"sky-blue"}}><u>Add Student</u></h1>

    <form className={classes.root} noValidate autoComplete= "Off">

      <TextField id="standard-basic" label="Student Name" variant="standard" fullWidth />
      
      <TextField id="standard-basic" label="Student Address" variant="standard" fullWidth />
      </form>
    </Paper>
    </Container>
  );
}
